import React from 'react';

import styled from 'styled-components';

import { v4 as uuidv4 } from 'uuid';

export default function CreateQuestion() {
  return (
    <Component>
      <div id={uuidv4()} className="question">
        <div className="q-div">
          <input type="text" id="q-input" />
          <label htmlFor="q-input">question</label>
        </div>
      </div>
    </Component>
  );
}

const Component = styled.div`
.question{
    box-shadow: 
    18px 18px 28px hsl(0 0% 0% / .24),
    -18px 18px 28px hsl(0 100% 100%),
    ;
}
`;
